import 'bootstrap/dist/css/bootstrap.css';

ReactDOM.render(<App />, document.getElementById('app'));

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);
